description:
The famous home of surfing also lays claim to an incredible ancient history of environmental stewardship. With the rediscovery of old values, the Hawaiians of today are beginning to learn that the knowledge of the ancients is just as relevant in the modern world.

This film follows an inspirational bunch of characters who make it clear that these beautiful islands have a powerful message for us all.

See the last few screenshots, and watch with amazement what the albatros eats...

